from pinferencia import Server, task


def return_text(data):
    return ["abcdefg"]


def return_image(data):
    return [
        ""  # noqa
    ]


service = Server()
service.register(
    model_name="invalid-task-model",
    model=return_text,
    metadata={"task": "invalid"},
)
service.register(
    model_name="return-text-model",
    model=return_text,
    version_name="v1",
    metadata={"task": task.TEXT_TO_TEXT},
)
service.register(
    model_name="returm-image-model",
    model=return_image,
    version_name="v1",
    metadata={"task": task.IMAGE_CLASSIFICATION},
)
